        const fetchMeals=async()=>{
            try {
                const responseData=await sendRequest(`http://localhost://7000/api/meals/user/${userId}`)
                setLoadedMeal(responseData.meals)
            } catch (err) {}
        }
        fetchMeals()
    },[sendRequest,userId])
